const initialState = {
    tasks:[
        {
            taskName: 'DZ',
            description: 'asdsad',
            endDate: '12.12.1998',
            mainTask: false
        },
        {
            taskName: 'Keksk',
            description: 'qewwqeeq',
            endDate: '01.01.2003',
            mainTask: false
        },
        {
            taskName: 'jopa',
            description: '[pop[o',
            endDate: '01.01.2020',
            mainTask: false
        },
    ]
};

export function taskReducer(state = initialState, action) {
    switch (action.type) {
        case 'KEK':
            return{
                ...state,
                tasks: action.tasks
            };
        case 'ADD_NEW_TASK':
            return{
                ...state,
            };
        default:
            return state

    }

}
